import React, {useRef} from "react";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { NavigationContainer } from "@react-navigation/native";
import { Ionicons } from '@expo/vector-icons';
import { AntDesign } from '@expo/vector-icons'; 
import { MaterialCommunityIcons } from '@expo/vector-icons'; 
import { MaterialIcons } from '@expo/vector-icons'; 
import { FontAwesome5 } from '@expo/vector-icons'; 






//screens
import HomeScreen from "./screens/HomeScreen";
import PersonajesScreen from "./screens/PersonajesScreen"
import StackScreen from "./screens/StackScreen";
import MomensScreen from "./screens/MomensScreen";
import ContratameScreen from "./screens/Contratame";
import AcercaScreen from "./screens/Acerca";
import EnMiVidaScreen from './screens/EnMiVidaScreen'


const Tab = createBottomTabNavigator();

function MyTabs() {
   return (
    <Tab.Navigator
    initialRouteName="Home"
    screenOptions={{
        tabBarActiveTintColor: 'purple'
    }}
    >
        <Tab.Screen 
        name="Home" 
        component={HomeScreen}
        options={{
            tabBarLabel: 'Feed',
            tabBarIcon: ({ color, size }) => (
        <Ionicons name="home" color={color} size={size} />
      ),
        }}
        ></Tab.Screen>

        <Tab.Screen 
        name="Personajes" 
        component={PersonajesScreen}
        options={{
            tabBarLabel: 'Personajes',
            tabBarIcon: ({color, size }) => (
                <Ionicons name="people-circle-sharp" size={size} color={color} />
            ),
        }}
        ></Tab.Screen>
        <Tab.Screen
        name="Momentos" 
        component={MomensScreen}
        options={{
            tabBarLabel: 'Momentos',
            tabBarIcon: ({color, size }) => (
                <AntDesign name="staro" size={size} color={color} />
            ),
        }}
        >

        </Tab.Screen>

        <Tab.Screen
        name="Acerca" 
        component={AcercaScreen}
        options={{
            tabBarLabel: 'Acerca De',
            tabBarIcon: ({color, size }) => (
        <MaterialIcons name="details" size={size} color={color} />            
        ),
        }}
        >

        </Tab.Screen>

        <Tab.Screen
        name="En mi vida" 
        component={EnMiVidaScreen}
        options={{
            tabBarLabel: 'En mi vida',
            tabBarIcon: ({color, size }) => (
<FontAwesome5 name="star-of-life" size={size} color={color} />        ),
        }}
        >

        </Tab.Screen>

        <Tab.Screen
        name="Contratame" 
        component={ContratameScreen}
        options={{
            tabBarLabel: 'Contratame',
            tabBarIcon: ({color, size }) => (
        <MaterialCommunityIcons name="contacts" size={size} color={color} /> 
                   ),
        }}
        >

        </Tab.Screen>

    </Tab.Navigator>
   );
}

export default function Navigation() {
    return (
        <NavigationContainer>
            <MyTabs></MyTabs>
        </NavigationContainer>
    );
}
